import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        {/* <img src={logo} className="App-logo" alt="logo" /> */}
        <h1 className="App-title">A Social Media App</h1>
        {/* <button className="Login-button">Login</button> */}
      </header>
      <nav className='navbar'>
        <button className='abutton'>button1</button>
        <button className='abutton'>button2</button>
        <button className='abutton'>button3</button>
        <button id='login' className='abutton'>button4</button>
      </nav>
    </div>
  );
}

export default App;
